import React, { Component } from 'react'

export default class List extends Component {
    render() {
        return (
            <div className="row">
                <div className="card">
                    <a href="https://gitthub.com/reactjs" target="_blank">
                        <img src="https://avatars.githubusercontent.com"/>
                    </a>
                </div>
            </div>
        )
    }
}
